# [0] = current_level (starts from 0 = level 1)			0
# [1] = selected (0:start, 1:exit)				4
# [2] = player_location						8
# [3] = player_facing (0:left, 1:right)				12
# [4] = player_moving (0:stable, 1:moving)			16
# [5] = player_jump (0 no jump, 1 start jump, 16 last jump)	20
# [6] = player_dash (0 no dash, 1 dash)				24
# [7] = player_lives (0 dead, 1-2-3)				28
# [8] = enemy_facing						32
# [9] = portal_location						36
# [10] = can_dash (0 no, 1 yes)					40
# [12] = enemy_location						44
# [13] = enemy2_location					48
# [14] = crystal3_location					52

game_data:	.word	0, 0, 0x10008000, 1, 0, 0, 18, 3, 1, 0x10008000, 0, 0x10008000, 0x10008000, 0x10008000


.eqv	BASE_ADDRESS	0x10008000
.eqv	HEADER_END	0x10009C00
.eqv	MAX_ADDRESS	0x10018000
.eqv RED 0xff0000
.eqv SKIN 0xffff00
.eqv BLUE 0x0000ff
.eqv SKY 0x00B7EF
.text
main:   
      	
      	
      	li $s0, BASE_ADDRESS	# first pixel in screen
	li $s1, MAX_ADDRESS	# last pixel + 1 in screen
	li $s2, HEADER_END	# last pixel+1 of header / first pixel of levels
	
	
	
	jal start_menu
      	

menu_input:
	li $t0, 0xffff0000
	lw $t1, ($t0)
	beq $t1, 1, read_menu_input
	j menu_input
	
read_menu_input:
	lw $t1, 4($t0)
	beq $t1, 0x73, switch_selected
	beq $t1, 0x77, switch_selected
	beq $t1, 0x70, reset
	beq $t1, 0x0A, enter_press
	j menu_input
	
switch_selected:
	li $t0, SKY
	lw $t1, game_data+4
	beq $t1, 1, set_start
	li $t1, 1
	sw $t0, 8456($s0)
	li $t0, 0
	sw $t0, 11856($s0)
	j store_switch
	set_start:
	li $t1, 0
	sw $t0, 11856($s0)
	li $t0, 0
	sw $t0, 8456($s0)
	store_switch:
	sw $t1, game_data+4	 
	j menu_input
	
	
enter_press:
	lw $t1, game_data+4
	beq $t1, 1, final
      	
load_game:
	# li $v0, 32	# sleep
	# li $a0, 1000
	# syscall
	
	
	
	li $t0, 1
	sw $t0, game_data+12	# player facing right
	sw $zero, game_data+16	# player stable
	sw $zero, game_data+20	# player not jumping
	sw $zero, game_data+40	# player can't dash
	sw $zero, game_data+32
	li $t1, 18
	sw $t1, game_data+24
	
	move $t0, $s0
	addi $t0, $t0, 1896
	sw $t0, game_data+44
	move $t0, $s0
	addi $t0, $t0, 12740
	sw $t0, game_data+48
	
	
	
	
	lw $t0, game_data
	beq $t0, 1, level_2
	beq $t0, 2, level_3
	
	level_1:
	jal start_level_1
	j game
	
	level_2:
	jal start_level_2
	j game
	
	level_3:
	jal start_level_3
	j game

	
	

game:
	li $t0, 0xffff0000
	lw $t1, ($t0)
	bne $t1, 1, no_input
	jal keypress_happened
	
	
	no_input:
	lw $a0, game_data+8
	jal unset_character
	
	lw $a0, game_data+44
	jal unset_enemy
	
	lw $a0, game_data+48
	jal unset_enemy
	
	j pyhsics
	post_pyhsics:
	lw $a0, game_data+8
	jal set_character
	
	
	lw $t0, game_data
	blt $t0, 2, skip_enemy
	
	
	lw $t0, game_data+32
	beqz $t0, enemy_left
	lw $t0, game_data+44
	add $t0, $t0, 4
	sw $t0, game_data+44
	lw $t0, game_data+48
	add $t0, $t0, 4
	sw $t0, game_data+48
	j enemy_movement_end
	enemy_left:
	lw $t0, game_data+44
	add $t0, $t0, -4
	sw $t0, game_data+44
	lw $t0, game_data+48
	add $t0, $t0, -4
	sw $t0, game_data+48
	
	enemy_movement_end:
	lw $t0, game_data+24
	addi $t0, $t0, -1
	sw $t0, game_data+24
	beqz $t0, set_enemy_direction
	lw $a0, game_data+44
	jal set_enemy
	lw $a0, game_data+48
	jal set_enemy
	
	skip_enemy:
	
	lw $t1, game_data+28
	beq $t1, 2, unset_two_heart
	beq $t1, 1, unset_one_heart
	j sleep
	
	
	unset_one_heart:
	la $a0, 14976($s0)
	jal unset_heart
	unset_two_heart:
	la $a0, 15000($s0)
	jal unset_heart
	
	
	sleep:
	li $v0, 32
	li $a0, 65
	syscall
	j game
	
set_enemy_direction:
	li $t0, 18
	sw $t0, game_data+24
	lw $t0, game_data+32
	beqz $t0, set_enemy_direction_right
