	beq $t1, 0x61, move_left 	# ASCII code of 'a' is 0x61 or 97 in decimal
	beq $t1, 0x64, move_right 	# ASCII code of 'd' is 0x64 or 100 in decimal
	beq $t1, 0x77, move_up 		# ASCII code of 'w' is 0x77 or 119 in decimal
	beq $t1, 0x73, move_down 	# ASCII code of 's' is 0x73 or 115 in decimal
	
	j game
	

	
move_up:

	lw $t0, game_data+8	# get player location
	add $t0, $t0, 1536	# go to under the player
	lw $t1, 0($t0)
	beq $t1, 0x0022B14C, jump	# check if color is ground, if yes set jump
	beq $t1, 0x009C5A3C, jump	# check if ground
	lw $t1, 4($t0)
	beq $t1, 0x0022B14C, jump	# check if color is ground, if yes set jump
	beq $t1, 0x009C5A3C, jump	# check if ground
