	jr $ra
	
	
	jump:
	li $t0, 1
	sw $t0, game_data+20	# start jump
	jr $ra
	
move_down:

	
	
	
	sw $zero, game_data+16	# stationary
	jr $ra
	
move_left:
	
	
	sw $zero, game_data+12	# facing left
	li $t0, 1
	sw $t0, game_data+16	# moving
	jr $ra

move_right:
	
	
	
	 
	li $t0, 1
	sw $t0, game_data+12	# facing right
	sw $t0, game_data+16	# moving
	jr $ra
	

pyhsics:

	
	lw $t0, game_data+12	# check facing direction
	bnez $t0, right_facing
	#check if moving
	lw $t0, game_data+16
	beqz $t0, check_jump	# if not moving skip to jump
	#else move_left (if no wall)
	lw $t0, game_data+8
	li $t1, 256
	div $t0, $t1
	mfhi $t1
	beqz $t1, check_jump	# if very left of screen, dont go and jump to jump
	
	li $t1, 1
	add $t0, $t0, -4	# go left of player
	lw $t1, 0($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 256($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 512($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 768($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 1024($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 1280($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	sw $t0, game_data+8
	j check_jump
	
	right_facing:
	#no_dash
	#check if moving
	lw $t0, game_data+16
	beqz $t0, check_jump	# if not moving skip to jump
	#else move_right (if no wall)
	lw $t0, game_data+8		# get position
	li $t1, 256
	div $t0, $t1
	mfhi $t1
	beq $t1, 248, check_jump	# if very position right of screen, dont go and jump to jump
	
	li $t1, 1
	add $t0, $t0, 8	# go right of player
	lw $t1, 0($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 256($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 512($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 768($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 1024($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	lw $t1, 1280($t0)
	beq $t1, 0x0022B14C, check_jump	# check if color is ground
	beq $t1, 0x009C5A3C, check_jump	# check if color is ground
	beq $t1, 0x00847979, spike_collision
	beq $t1, 0x00ab16ca, spike_collision
	beq $t1, 0x00FF0000, flag_collision
	
	add $t0, $t0, -4
	sw $t0, game_data+8
	
	check_jump:
	lw $t0, game_data+20	# jump step
	lw $t1, game_data+8	# player location
	beqz $t0, gravity	# if no jump, apply gravity
	#else apply jump
	li $t2, 256
	add $t3, $t1, -0x10008000
	div $t3, $t2
	mflo $t2
	ble $t2, 0, end_jump
	li $t2, 16
	bgt, $t0, $t2, end_jump	# after 16 pixels end jump
	add $t1, $t1, -256	# go above the player
	lw $t2, 0($t1)
	beq $t2, 0x0022B14C, end_jump	# check if color is ground
	beq $t2, 0x009C5A3C, end_jump	# check if color is ground
	beq $t2, 0x00847979, spike_collision
	beq $t2, 0x00ab16ca, spike_collision
	beq $t2, 0x00FF0000, flag_collision
	lw $t2, 4($t1)
	beq $t2, 0x0022B14C, end_jump	# check if color is ground
	beq $t2, 0x009C5A3C, end_jump	# check if color is ground
	beq $t2, 0x00847979, spike_collision
	beq $t2, 0x00ab16ca, spike_collision
	beq $t2, 0x00FF0000, flag_collision
	add $t1, $t1, 256	# go back to player
	#else move up
	add $t0, $t0, 1
	sw $t0, game_data+20
	add $t1, $t1, -256
	sw $t1, game_data+8
	j post_pyhsics
	
	end_jump:
	sw $zero, game_data+20
	j post_pyhsics
	
	gravity:
	add $t1, $t1, 1536	# go to under the player

	lw $t2, 0($t1)
	beq $t2, 0x0022B14C, end_pyhsics	# check if color is ground
	beq $t2, 0x009C5A3C, end_pyhsics	# check if color is ground
	beq $t2, 0x00847979, spike_collision
	beq $t2, 0x00ab16ca, spike_collision
	beq $t2, 0x00FF0000, flag_collision
	lw $t2, 4($t1)
	beq $t2, 0x0022B14C, end_pyhsics	# check if color is ground
	beq $t2, 0x009C5A3C, end_pyhsics	# check if color is ground
	beq $t2, 0x00847979, spike_collision
	beq $t2, 0x00ab16ca, spike_collision
	beq $t2, 0x00FF0000, flag_collision
	add $t1, $t1, -1280	# go back to player -1
	sw $t1, game_data+8
	
	end_pyhsics:
	j post_pyhsics

      	
      	
